import React from 'react';
import { useExperiment } from '../context/ExperimentContext';

const GroundTruthFloorPlan = () => {
  const { targetAreas, roomLayout, lightStatus, floorPlanOrientation } = useExperiment();

  // Use room layout if available, otherwise default to 4 rooms
  const rooms = roomLayout?.rooms || [
    { id: 'A', left: 0, top: 0, width: 400, height: 300 },
    { id: 'B', left: 400, top: 0, width: 400, height: 300 },
    { id: 'C', left: 0, top: 300, width: 533, height: 300 },
    { id: 'D', left: 533, top: 300, width: 267, height: 300 }
  ];

  // Determine initial light states based on lightStatus
  const getInitialLightState = (roomId) => {
    if (lightStatus === 'allOn') return true;
    if (lightStatus === 'allOff') return false;
    if (lightStatus === 'mixed') {
      // For mixed, show some lights on (can be random or based on target areas)
      // For ground truth, we'll show target areas as they should be (ON)
      return targetAreas.includes(roomId);
    }
    return false;
  };

  return (
    <div className="w-full p-6 bg-white rounded-xl shadow-lg">
      <h2 className="text-2xl font-bold text-gray-800 mb-2 text-center">
        Ground Truth Floor Plan
      </h2>
      <p className="text-sm text-gray-600 mb-4 text-center">
        Task: Turn ON the highlighted areas
      </p>

      {/* Floor Plan Container - with rotation */}
      {/* Container needs to be large enough to accommodate rotated floor plan */}
      <div className="max-w-5xl mx-auto" style={{ 
        minHeight: '800px',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        padding: '20px'
      }}>
        <div 
          className="relative border-4 border-black bg-gray-50 rounded-lg"
          style={{ 
            width: '800px',
            height: '600px',
            maxWidth: 'calc(100% - 40px)',
            maxHeight: 'calc(100% - 40px)',
            transform: `rotate(${floorPlanOrientation || 0}deg)`,
            transformOrigin: 'center center'
          }}
        >
          {/* Render rooms from layout */}
          {rooms.map((room, index) => {
            const isTarget = targetAreas.includes(room.id);
            const shouldBeOn = getInitialLightState(room.id);
            const isHighlighted = isTarget; // Highlight target areas

            // Check if there's a room to the right or below
            const hasRoomRight = rooms.some(r => 
              Math.abs(r.top - room.top) < 5 && 
              Math.abs(r.left - (room.left + room.width)) < 5
            );
            const hasRoomBelow = rooms.some(r => 
              Math.abs(r.left - room.left) < 5 && 
              Math.abs(r.top - (room.top + room.height)) < 5
            );

            return (
              <div
                key={room.id}
                className="absolute transition-all duration-300"
                style={{
                  left: `${(room.left / 800) * 100}%`,
                  top: `${(room.top / 600) * 100}%`,
                  width: `${(room.width / 800) * 100}%`,
                  height: `${(room.height / 600) * 100}%`,
                  borderRight: hasRoomRight ? '2px solid #9ca3af' : 'none',
                  borderBottom: hasRoomBelow ? '2px solid #9ca3af' : 'none'
                }}
              >
                <div className="w-full h-full flex items-center justify-center relative">
                  {/* Circular button with letter - highlighted if target */}
                  <div
                    className={`w-16 h-16 rounded-full border-4 flex items-center justify-center text-2xl font-bold transition-all duration-300 ${
                      isHighlighted
                        ? 'bg-yellow-200 border-yellow-500 shadow-lg shadow-yellow-400/50'
                        : shouldBeOn
                        ? 'bg-cyan-200 border-cyan-400 shadow-lg shadow-cyan-400/50'
                        : 'bg-white border-black'
                    }`}
                  >
                    {room.id}
                  </div>
                  {/* Highlight overlay for target areas */}
                  {isHighlighted && (
                    <div className="absolute inset-0 bg-yellow-200/40 rounded-lg pointer-events-none border-2 border-yellow-500"></div>
                  )}
                  {/* Indicator for lights that should be on */}
                  {shouldBeOn && !isHighlighted && (
                    <div className="absolute inset-0 bg-cyan-200/30 rounded-lg pointer-events-none"></div>
                  )}
                </div>
              </div>
            );
          })}
        </div>
      </div>

      {/* Legend */}
      <div className="mt-6 flex justify-center gap-6 text-sm flex-wrap">
        <div className="flex items-center gap-2">
          <div className="w-5 h-5 rounded-full border-4 border-yellow-500 bg-yellow-200"></div>
          <span className="text-gray-700 font-semibold">Target Area (Turn ON)</span>
        </div>
        <div className="flex items-center gap-2">
          <div className="w-5 h-5 rounded-full border-4 border-cyan-400 bg-cyan-200"></div>
          <span className="text-gray-700">Light ON</span>
        </div>
        <div className="flex items-center gap-2">
          <div className="w-5 h-5 rounded-full border-4 border-black bg-white"></div>
          <span className="text-gray-700">Light OFF</span>
        </div>
      </div>

      {/* Orientation indicator */}
      {floorPlanOrientation && floorPlanOrientation !== 0 && (
        <div className="mt-4 text-center text-sm text-gray-600">
          Orientation: {floorPlanOrientation}Â°
        </div>
      )}
    </div>
  );
};

export default GroundTruthFloorPlan;
